import AIVisual from './components/AIVisual';

function App() {
  return (
    <div style={{
      backgroundColor: '#0A0B0F',
      color: '#FFFFFF',
      minHeight: '100vh',
      overflow: 'hidden',
      position: 'relative',
    }}>
      <main style={{
        maxWidth: '1400px',
        margin: '60px auto',
        padding: '0 40px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        position: 'relative',
      }}>
        {/* Left Content */}
        <div style={{ maxWidth: '600px' }}>
          <h1 style={{
            fontSize: '72px',
            lineHeight: '1.1',
            marginBottom: '24px',
          }}>
            The Next
            <br />
            <span style={{ color: '#61DAFB' }}>Generation</span>
            <br />
            Payment Method.
          </h1>

          <p style={{
            color: '#8F9BA8',
            fontSize: '18px',
            lineHeight: '1.6',
            marginBottom: '40px',
          }}>
            Our team of experts uses a methodology to identify
            the credit cards most likely to fit your needs.
          </p>
        </div>

        {/* Right Content */}
        <AIVisual />
      </main>
    </div>
  );
}

export default App;
